Small concert hall (w/2000 friends). 

Not a fest set, but a full tour show.

Beautifully filmed and performed. 

Not the visceral, mad dance party of the doll et al Lollapalooza, just a sweet wonder to swing lo and behold dear.


2014-08-23 @ The Pirate Bay around thewaymouth


AUGUST 23 - Lithuania: HARVEST FESTIVAL. Ridiculous speeches, feasting &amp; dancing. In the &quot;Kirvis,&quot; a pretty maiden stands in the center of a circle of dancers, holding an axe. The circle sings, the axe is thrown, &amp; the young man who catches it, often bleeding, gets a kiss &amp; a dance.


